import React , {useState , useEffect} from 'react'
import axios from 'axios'
import { useNavigate } from 'react-router-dom'
import '../components/searchdishes.css';
import { addToCart } from './reducer';
import { useDispatch } from 'react-redux';


function SearchDishes() {

  const [dishName , setDishName] = useState("")
  const [dishes , setDishes] = useState([])

  let dispatch = useDispatch()

  useEffect(()=>{
    if(dishName.length > 2)
    {
      axios.get(`https://www.swiggy.com/dapi/restaurants/search/v3?lat=17.372040&lng=78.43780
      &str=${dishName}&trackingId=undefined&submitAction=SUGGESTION&queryUniqueId=e8f976e5-270e-3d4d-aca0-573a2513c73a`)
      .then((res)=>{
        if(res.data.data?.cards[1]?.groupedCard?.cardGroupMap?.DISH){
          setDishes(res.data.data?.cards[1]?.groupedCard?.cardGroupMap.DISH.cards.slice(1))
        }
    })
  }
  },[dishName])

  console.log(dishes)

  let navigate = useNavigate();

  return (
    <div>
      <div style={{textAlign : "center"}}>
        <h2>SearchDishes</h2>
        {/* <input type = "text"
        value = {dishName}
        onChange = {(e)=>{
          setDishName(e.target.value)
        }}
        placeholder='Search the dishes'/> */}
         <form className="d-flex justify-content-center" role="search">
          <div className="col-md-6 col-lg-4 m-2 clearable-input">
            <input
              className="form-control"
              value={dishName}
              onChange={(e) => {
                setDishName(e.target.value);
              }}
              type="search"
              placeholder="Search the dishes"
              aria-label="Search"
            />
          </div>
        </form>
      </div><br/>
      <div className='container'>
        <div class="row row-cols-1 row-cols-md-2 g-2">
          {dishes.map((item ,i)=>{
            return  <div class="col">
              <div class="card h-100 p-4" id = "dishescard">
                <h1 class="card-title" id = "restaurantname">{item?.card?.card?.restaurant?.info?.name}</h1>
                <h6 class = 'card-rating'>Rating , Time to deliver </h6>
                <h5 class = 'card-rating'>&#8377;{item?.card?.card?.info?.price/100}</h5>
                <div>
                  <button className='restaurant-view'
                    onClick={() => {
                      navigate(`/restaurant/${item?.card?.card?.restaurant?.info?.id}/${item?.card?.card?.restaurant?.info?.name}`);
                      console.log(item?.card?.card?.restaurant?.info?.id);
                    }}
                  >View Restaurant</button>
                </div>
                <div className='row'>
                  <div className = "col-6">
                <img src={`https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_600/${item?.card?.card?.info?.imageId}`} class="card-img-top h-10" alt="..."/>
                </div>
                <div class="card-body col-6">
                  <h5 class="card-title">{item?.card?.card?.info?.name}</h5>
                  <p class="card-text" id = "card-desc">{item?.card?.card?.info?.description}</p>
                  <button 
                  onClick={()=>{
                    dispatch(addToCart({Name : item?.card?.card?.info?.name , Description : item?.card?.card?.info?.description ,Price : item?.card?.card?.info?.price/100 ,
                      Img : `https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_600/${item?.card?.card?.info?.imageId}`
                    }))
                  }}
                  className='restaurant-view'> Add to cart</button>
                </div>
                </div>
              </div>
            </div>
          })}
        </div>
      </div>
    </div>
  )
}

export default SearchDishes
